func TestDecodeEscapedJSONString(t *testing.T) {
	sampleString := "\"113c3a32a9d320b72190a04a020a0db3976ef36972673258e9a38a364f3dc3b0\""

	result, err := DecodeEscapedJSONString(sampleString)
	assert.NoError(t, err)
	assert.Equal(t, result, "113c3a32a9d320b72190a04a020a0db3976ef36972673258e9a38a364f3dc3b0")
}

func TestDecodeBtcStakingTx(t *testing.T) {
	encodingTx := "AgAAAAEV+HqXcrYPtvInS3ygpwH2bK/I4JhHdNMBbmh6ht3sTgAAAAAA/////wJQwwAAAAAAACJRIHitg+6DT820A8/DE8LWeEN6BFZiPpMkj4URXmap+uAOfXYOAAAAAAAiUSAtyerAPfEAfA5g4Vn/341CdaYRMelp7cwDvkKfNnMFDgAAAAA="

	btcStakingTxHash, err := DecodeBtcStakingTx(encodingTx)
	assert.NoError(t, err)
	assert.Equal(t, btcStakingTxHash, "0b1cbcdd64a4f17ccb85475e1c1816a16d78d91ab33934697255d76bac15c2c4")

}

